import React from "react";
import { useState } from "react";
import './NavBar.css';
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import PersonIcon from '@mui/icons-material/Person';
import WorkIcon from '@mui/icons-material/Work';
import ContactPageIcon from '@mui/icons-material/ContactPage';
import HomeIcon from '@mui/icons-material/Home';

function NavBar() {
  const [value, setValue] = useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };
  return (
    <div className="nav-bar">
        <div className='name'>
          <p> Aman.dev </p>
        </div>
        <div className = "tools" >
          <Tabs role="navigation" value={value} onChange={handleChange} aria-label="Navigation" centered="true"
          TabIndicatorProps={{
            style: {
              backgroundColor: '#ff5722', // Set the desired color for the tab indicator
            },
          }}>
            <Tab className="navTab" icon={<HomeIcon/>} aria-label="home" href="/"/>
            <Tab className="navTab" icon={<PersonIcon/>} aria-label="about" href="/about"/>
            <Tab className="navTab" icon={<WorkIcon/>} aria-label="experience" href="/experience"/>
            <Tab className="navTab" icon={<ContactPageIcon/>} aria-label="contact" href="/contact"/>
          </Tabs>
        </div>
      </div>
  );
}

export default NavBar;
